import React from "react";
import styled from "styled-components";

const UnOrderedList = styled.ul`
    list-style: none;
    margin: 0px;
    padding: 0px;
    li {
        background: #fff;
        width: 100%;
        cursor: pointer;
        line-height: 3rem;
        margin: 2px;
        padding: 2px;
    }

    li:hover {
        color: #c2c2c2;
    }
`

export default function AppNavigationMenu() {
  return (
    <React.Fragment>
      <UnOrderedList>
        <li>Assets</li>
        <li>Accounts</li>
        <li>Contacts</li>
        <li>Active Assets</li>
        <li>Reports</li>
      </UnOrderedList>
    </React.Fragment>
  );
}
